  false,\n\t\"url\": null,\n\t\"notes\": \"This data set comprises the Environmental
  Sensitivity Index (ESI) maps in Portable Document Format (.PDF) for the shoreline
  of East Florida (to encompass the coastal areas from the Florida/Georgia border
  to Boca Raton, Florida). ESI data characterize coastal environments and wildlife
  by their sensitivity to spilled oil. The ESI data include information for three
  main components: shoreline habitats; sensitive biological resources; and human-use
  resources. This Atlas was compiled from geographical and biological data collected
  from 1950-1990s; the intertidal habitats were mapped during aerial and ground surveys
  conducted in May, 1993, and biological and human-use resources data were compiled
  by regional biologists in 1995. The dates for the original data vary and are completely
  documented in within the included FGDC metadata file \"METADATA.PDF\" and document
  \"INTRO.PDF\".nnAn associated data set, Environmental Sensitivity Index Atlas (ESI)
  Florida 1995-1997 Digital Data Re-Release is available as NODC Accession 0014187.\",\n\t\"license_title\":
